import React from "react";
import CommonTable from "../components/common/CommonTable";
import AddVendorDialog from "../components/forms/addVendor";
import { Vendor_Api } from "../api/vendor_api";

const HeaderValue = ["Vendor Name", "Mobile", "Email", "Location"];

const addVendor = () => {
  setmodalOpen("true");
};

const Vendor = () => {
  const [modalOpen, setmodalOpen] = React.useState(false);
  const [auth, setAuth] = React.useState(true);
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  return (
    <React.Fragment>
      <CommonTable
        Header={HeaderValue}
        buttonLabel={"Add Vendor"}
        onClick={this.addVendor}
      />
      {modalOpen && <AddVendorDialog />}
    </React.Fragment>
  );
};

export default Vendor;
